class V2Operation {
    constructor(data, operation_id) {
        this.id = operation_id;
        this.product_name = data.product.split('_')[2];
        this.product_alias = this.product_name;
        this.date = data.date;
        this.area = data.area;
        this.total = data.people;
        this.teams = {};
        if (!!data.teams){
            Object.keys(data.teams).forEach(teamId => {
                this.teams[teamId] = {
                    id : teamId,
                    notification: data.teams[teamId].message,
                    guides : [],
                    reservations : {}
                };
                if (!! data.teams[teamId].guide) {
                    data.teams[teamId].guide.forEach(guide => {
                        if (!!guide) this.teams[teamId].guides.push({ id : guide,  name : "" });
                    });
                }
                if (!! data.teams[teamId].reservations) {
                    Object.keys(data.teams[teamId].reservations).forEach(reservation_id => {
                        this.teams[teamId].reservations[reservation_id] = {
                            id : reservation_id,
                            name : data.teams[teamId].reservations[reservation_id].clientName,
                            nationality : data.teams[teamId].reservations[reservation_id].nationality,
                            agency : data.teams[teamId].reservations[reservation_id].agency,
                            pickup : data.teams[teamId].reservations[reservation_id].pickupPlace,
                            adult : data.teams[teamId].reservations[reservation_id].adult,
                            child : data.teams[teamId].reservations[reservation_id].kid,
                            infant : data.teams[teamId].reservations[reservation_id].infant,
                            option : [],
                            memo : data.teams[teamId].reservations[reservation_id].memo,
                            g : data.teams[teamId].reservations[reservation_id].gCheck,
                            o : data.teams[teamId].reservations[reservation_id].oCheck
                        };
                        if (!!data.teams[teamId].reservations[reservation_id].option) {
                            data.teams[teamId].reservations[reservation_id].option.forEach(option => {
                                this.teams[teamId].reservations[reservation_id].option.push({
                                    name : option.option,
                                    number : option.people
                                })
                            });
                        }
                    });
                }
            });
        }
    }
}

function objToMap(operation){
    const tempData = {};
    Object.keys(operation).forEach(id => {
        let teamMap = new Map();
        Object.keys(operation[id].teams).forEach(team_id => {
            let reservationMap = new Map();
            Object.keys(operation[id].teams[team_id].reservations).forEach(reservation_id => {
                reservationMap.set(reservation_id, operation[id].teams[team_id].reservations[reservation_id]);
            });
            teamMap.set(id, {
                id : team_id,
                notification: operation[id].teams[team_id].message,
                guides : operation[id].teams[team_id].guides,
                reservations : reservationMap
            });
        })
    })
}
const fs = require('fs');
function convert(data, idArray){
    return new Promise((resolve ,reject) => {
        const newOperation = {};
        let count = 0;
        Object.keys(data).forEach(date => {
            // console.log('date : ',date)
            newOperation[date] = {};
            if (date !== "teams") {
                Object.keys(data[date]).forEach(operation_id => {
                    newOperation[date][idArray[count]] = new V2Operation(data[date][operation_id], idArray[count]);
                    count += 1
                });
            }
        });
        console.log(JSON.stringify(newOperation));
        resolve(JSON.stringify(newOperation));
    });
}
